import React from "react";
import "./mainMenu.css";
import images from "../../img/image";
import SimpleImageSlider from "react-simple-image-slider";



const sideleft = () => {
  var sileder = document.getElementById("slider");
  sileder.scrollTop = sileder.scrollTop - 800;
};

const sideright = () => {
  var sileder = document.getElementById("slider");
    sileder.scrollTop = sileder.scrollTop + 800;
};

const imagelist = [images.sliderImg1,images.sliderImg2,images.sliderImg3,images.sliderImg4]
export default function MainMenu() {
  return (
    <main>
      <section className="slider">
      <SimpleImageSlider width={916} height={404} images={imagelist} showBullets={true} autoPlay={true} autoPlayDelay={3.0} />
      </section>
      
    </main>
    
  );
}
